import { LoadScript, GoogleMap, Marker, Polyline } from "@react-google-maps/api";

export const Map = () => {
  const initialLatLng = { lat: 34.48520833, lng: 136.8251525}; // 初期位置の緯度経度
  let map;
  let parameters = {};
  let polyline = null;

  const container = {
    width : "80vw",
    height : "100vh",
    // top : "0",
    // right : "0"
  };

  const position = {
    lat: 34.48520833, 
    lng: 136.8251525
  };

  // 地図表示
  function initMap() {
    map = new google.maps.Map(document.getElementById('map'), {
        center: initialLatLng,
        zoom: 20,
        mapTypeId: google.maps.MapTypeId.SATELLITE,
    });
  };


  return (
    <div className="wrap">
      <div id="map">

      </div>
      <script async defer src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCjpcBI57XAEzvIqzNBEj4eIpVzRaRe93U&callback=initMap"></script>
    </div>
  )
}
